import React from "react";
import logo from "../assets/coxdiack-logo.png"; // ✅ Path to your image

export default function Home({ setActive }) {
  return (
    <section className="relative p-10 text-center min-h-screen flex flex-col justify-center items-center bg-gradient-to-b from-[#0A1837] to-[#071226] text-white">
      {/* Full-width logo */}
      <div className="w-full mb-8">
        <img
          src={logo}
          alt="Coxdiack Group Logo"
          className="w-full h-40 object-contain"
        />
      </div>

      {/* Welcome content */}
      <h1 className="text-5xl font-bold mb-4">
        Welcome to <span className="text-[#00FFA3]">Coxdiack Group</span>
      </h1>

      <p className="text-lg text-gray-300 max-w-2xl mb-8">
        We craft digital experiences and creative solutions for modern brands.
        Explore our portfolio to see what we’ve been up to.
      </p>

      <button
        onClick={() => setActive("portfolio")}
        className="bg-[#00FFA3] text-[#071226] px-6 py-3 rounded-lg font-semibold hover:bg-[#00cc82] transition-all"
      >
        Explore Portfolio
      </button>
    </section>
  );
}
